import React from "react";
import "./FindPage.css"

function MyPageFree() {
    return(
    <div className='find-container'>
        <h1>아이디(이메일) 찾기</h1>
        <p className="subText">계정에 등록된 휴대폰 번호를 인증하시면 사용 중인 계정의 이메일을 알려드립니다.</p>
        <p className="grid-item">휴대폰 번호(숫자만 입력)</p>
        <div className="find-submit-form">
            <input type="email" id="email" placeholder="01012341234" />
            <button>인증 요청</button>
        </div>

        <p className="grid-item">인증번호</p>
        <div className="find-submit-form">
            <input type="text" id="code" placeholder="인증번호 입력" />
            <button>인증</button>
        </div>
    </div>
    );
}

export default MyPageFree;
